import React from "react";
import ReactDOM from 'react-dom';
import './index.css';

import{
BrowserRouter as Router,
Routes,
Route,
} from "react-router-dom"

import OfertAdd from "./Ofert/OfertAdd"
import CategoriesAdd from "./Category/CategoriesAdd"
import Hello from "./Hello";
import Register from "./Register";
import Login from "./Login";
import Error from "./Error";
import CategoryOption from "./Category/CategoryOption";
import OfertSelect from "./Ofert/OfertSelect";
import Navbar from "./Navbar";
import CategoriesSelect from "./Category/CategoriesSelect";
import OfertSelectByID from "./Ofert/OfertSelectByID";

function App(){
  function getCookie(name) {
    var dc = document.cookie;
    var prefix = name + "=";
    var begin = dc.indexOf("; " + prefix);
    if (begin === -1) {
        begin = dc.indexOf(prefix);
        if (begin !== 0) return null;
    }
    else
    {
        begin += 2;
        var end = document.cookie.indexOf(";", begin);
        if (end === -1) {
        end = dc.length;
        }
    }
    // because unescape has been deprecated, replaced with decodeURI
    //return unescape(dc.substring(begin + prefix.length, end));
    return decodeURI(dc.substring(begin + prefix.length, end));
} 

function doSomething() {
    var myCookie = getCookie("userId");

    if (myCookie === null) {
      <Route exact path='/' element={<div className="container"><OfertSelect /></div>} />
    }
    else {
      <Route exact path='/' element={<div className="container"></div>} />
    }
}

    return(



      <Router>
        <Navbar /><Hello login="studencie" /> 
        <Routes>
          doSomething()
          <Route path={'/login'} element={<div className="container"><Login /></div> } />
          <Route path={'/register'} element={<div className="container"><Register /></div> } />
          <Route path={'/Ofert'} element={<div className="container"><OfertAdd /><OfertSelect /></div> } />
          <Route path={'/OfertInfo'} element={<div className="container"><CategoryOption /></div> } />
          <Route path={'/Category'} element={<div className="container"><CategoriesAdd /><CategoriesSelect /><OfertSelectByID /></div> } />
          <Route path='*' element={<Error /> } />
        </Routes>
        </Router>);


  }

ReactDOM.render(<App/>,document.getElementById('root'));
